import React from 'react';
import { Link, Routes, Route } from 'react-router-dom';
import '../styles/homepage.css';

// Dummy components for Invoices and Reminders
const Invoices = () => <h2>Invoices Page (Dummy Content)</h2>;
const Reminders = () => <h2>Reminders Page (Dummy Content)</h2>;
const DefaultPage = () => <h2>Welcome to the Homepage! Select a menu item.</h2>;

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Fixed Sidebar */}
      <aside className="sidebar">
        <div className="logo">
          <h2>invoicequick</h2>
        </div>
        <nav>
          <ul>
            <li><Link to="invoices">Invoices</Link></li>
            <li><Link to="reminders">Reminders</Link></li>
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <Routes>
          <Route path="/" element={<DefaultPage />} />
          <Route path="invoices" element={<Invoices />} />
          <Route path="reminders" element={<Reminders />} />
        </Routes>
      </main>
    </div>
  );
};

export default HomePage;
